import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Home from './pages/Home';
import SpaceDetails from './pages/SpaceDetails';
import AddSpace from './pages/AddSpace';
import Favorites from './pages/Favorites';
import HostDashboard from './pages/HostDashboard';
import UserDashboard from './pages/UserDashboard';
import Reservation from './pages/Reservation';
import Login from './pages/Login';
import Register from './pages/Register';
import AIPlanner from './pages/AIPlanner';
import MessageCenter from './components/MessageCenter';
import './index.css';

function App() {
  // Initial data
  const initialSpaces = [
    {
      id: 1,
      name: 'Garage Grande',
      location: 'Centro',
      price: 150,
      type: 'garage',
      description: 'Espacioso y bien iluminado',
      rating: 4.5,
      features: ['Seguridad 24/7', 'Acceso controlado', 'Iluminación LED'],
      status: 'active',
      ownerId: 2
    },
    {
      id: 2,
      name: 'Pequeño Almacén',
      location: 'Sur',
      price: 80,
      type: 'almacen',
      description: 'Perfecto para almacenamiento temporal',
      rating: 4.2,
      features: ['Ventilación', 'Sistema de seguridad', 'Acceso 24/7'],
      status: 'active',
      ownerId: 3
    },
    {
      id: 3,
      name: 'Garage Privado',
      location: 'Norte',
      price: 200,
      type: 'garage',
      description: 'Ideal para vehículos grandes',
      rating: 4.8,
      features: ['Control remoto', 'Cámaras de seguridad', 'Techo alto'],
      status: 'active',
      ownerId: 2
    },
    {
      id: 4,
      name: 'Oficina Compartida',
      location: 'Este',
      price: 120,
      type: 'oficina',
      description: 'Incluye WiFi y electricidad',
      rating: 4.0,
      features: ['WiFi', 'Aire acondicionado', 'Escritorios'],
      status: 'active',
      ownerId: 4
    },
    {
      id: 5,
      name: 'Almacén Techado',
      location: 'Centro',
      price: 100,
      type: 'almacen',
      description: 'Buena ventilación y seguridad',
      rating: 4.6,
      features: ['Techo alto', 'Puerta ancha', 'Vigilancia'],
      status: 'active',
      ownerId: 3
    },
  ];

  // States
  const [spaces, setSpaces] = useState(initialSpaces);
  const [favorites, setFavorites] = useState(() => {
    const savedFavorites = localStorage.getItem('favorites');
    return savedFavorites ? JSON.parse(savedFavorites) : [];
  });
  const [user, setUser] = useState(() => ({
    id: 1,
    name: 'Usuario de Prueba',
    email: 'usuario@test.com',
    role: ['user'],
    avatar: null
  }));
  const [reservations, setReservations] = useState(() => {
    const savedReservations = localStorage.getItem('reservations');
    return savedReservations ? JSON.parse(savedReservations) : [];
  });
  const [reviews, setReviews] = useState([]);
  const [messages, setMessages] = useState(() => {
    const savedMessages = localStorage.getItem('messages');
    return savedMessages ? JSON.parse(savedMessages) : [];
  });

  // Local Storage Persistence
  useEffect(() => {
    localStorage.setItem('favorites', JSON.stringify(favorites));
  }, [favorites]);

  useEffect(() => {
    localStorage.setItem('reservations', JSON.stringify(reservations));
  }, [reservations]);

  useEffect(() => {
    localStorage.setItem('spaces', JSON.stringify(spaces));
  }, [spaces]);

  useEffect(() => {
    localStorage.setItem('messages', JSON.stringify(messages));
  }, [messages]);

  // Handlers
  const handleFavorite = (id) => {
    setFavorites((prev) =>
      prev.includes(id) ? prev.filter((fav) => fav !== id) : [...prev, id]
    );
  };

  const handleAddSpace = (newSpace) => {
    const spaceWithId = {
      ...newSpace,
      id: spaces.length + 1,
      rating: 0,
      status: 'active',
      features: newSpace.features || [],
      ownerId: user.id
    };
    setSpaces((prev) => [...prev, spaceWithId]);
  };

  const handleDeleteSpace = (id) => {
    setSpaces(prev => prev.filter(space => space.id !== id));
  };

  const handleEditSpace = (id, updatedSpace) => {
    setSpaces(prev => prev.map(space =>
      space.id === id ? { ...space, ...updatedSpace } : space
    ));
  };

  const handleReserve = async (spaceId, startDate, endDate) => {
    try {
      const space = spaces.find((space) => space.id === spaceId);
      if (!space) {
        throw new Error('Space not found');
      }

      // Calculate total price
      const start = new Date(startDate);
      const end = new Date(endDate);
      const days = Math.ceil((end - start) / (1000 * 60 * 60 * 24));
      const basePrice = days * space.price;
      const serviceFee = basePrice * 0.1;
      const totalPrice = basePrice + serviceFee;

      const newReservation = {
        id: reservations.length + 1,
        spaceId,
        userId: user?.id || 1,
        spaceName: space.name,
        startDate,
        endDate,
        totalPrice,
        status: 'confirmed',
        createdAt: new Date().toISOString(),
        location: space.location,
        spaceType: space.type,
        ownerId: space.ownerId
      };

      setReservations(prev => [...prev, newReservation]);

      // Simulate API delay
      await new Promise(resolve => setTimeout(resolve, 1000));

      return newReservation;
    } catch (error) {
      console.error('Error creating reservation:', error);
      throw error;
    }
  };

  const handleAddReview = (spaceId, review) => {
    const newReview = {
      id: reviews.length + 1,
      spaceId,
      userId: user?.id || 1,
      userName: user?.name || 'Usuario Anónimo',
      ...review,
      createdAt: new Date().toISOString()
    };
    setReviews(prev => [...prev, newReview]);

    // Update space rating
    const spaceReviews = [...reviews, newReview].filter(r => r.spaceId === spaceId);
    const averageRating = spaceReviews.reduce((acc, r) => acc + r.rating, 0) / spaceReviews.length;

    handleEditSpace(spaceId, { rating: averageRating });
  };

  const handleSendMessage = (recipientId, content) => {
    const newMessage = {
      id: messages.length + 1,
      senderId: user?.id || 1,
      recipientId,
      content,
      timestamp: new Date().toISOString(),
      read: false
    };
    setMessages(prev => [...prev, newMessage]);
  };

  const ProtectedRoute = ({ children, condition }) => {
    return condition ? children : <Login setUser={setUser} />;
  };

  return (
    <Router>
      <div className="flex flex-col min-h-screen">
        <Navbar user={user} setUser={setUser} />
        <div className="flex-grow">
          <Routes>
            <Route
              path="/"
              element={
                <Home
                  spaces={spaces}
                  onFavorite={handleFavorite}
                  favorites={favorites}
                  user={user}
                  onReserve={handleReserve}
                  reservations={reservations}
                />
              }
            />
            <Route
              path="/space/:id"
              element={
                <SpaceDetails
                  spaces={spaces}
                  onFavorite={handleFavorite}
                  favorites={favorites}
                  user={user}
                  reviews={reviews}
                  onAddReview={handleAddReview}
                />
              }
            />
            <Route
              path="/space/:id/reserve"
              element={
                <ProtectedRoute condition={!!user}>
                  <Reservation
                    spaces={spaces}
                    reservations={reservations}
                    onReserve={handleReserve}
                    onNavigateBack={() => window.history.back()}
                    onNavigateHome={() => window.location.href = '/'}
                    onReservationComplete={() => {
                      window.location.href = '/user-dashboard';
                    }}
                  />
                </ProtectedRoute>
              }
            />
            <Route
              path="/add-space"
              element={
                <ProtectedRoute condition={user?.role?.includes('host')}>
                  <AddSpace user={user} onAddSpace={handleAddSpace} />
                </ProtectedRoute>
              }
            />
            <Route
              path="/favorites"
              element={
                <ProtectedRoute condition={!!user}>
                  <Favorites
                    spaces={spaces}
                    favorites={favorites}
                    onFavorite={handleFavorite}
                  />
                </ProtectedRoute>
              }
            />
            <Route
              path="/host-dashboard"
              element={
                <ProtectedRoute condition={user?.role?.includes('host')}>
                  <HostDashboard
                    spaces={spaces}
                    onDeleteSpace={handleDeleteSpace}
                    onEditSpace={handleEditSpace}
                    reservations={reservations}
                  />
                </ProtectedRoute>
              }
            />
            <Route
              path="/user-dashboard"
              element={
                <ProtectedRoute condition={!!user}>
                  <UserDashboard
                    userId={user?.id || 1}
                    reservations={reservations}
                    spaces={spaces}
                  />
                </ProtectedRoute>
              }
            />
            <Route
              path="/ai-planner"
              element={
                <ProtectedRoute condition={!!user}>
                  <AIPlanner spaces={spaces} />
                </ProtectedRoute>
              }
            />
            <Route
              path="/messages"
              element={
                <ProtectedRoute condition={!!user}>
                  <MessageCenter
                    currentUserId={user?.id}
                    messages={messages}
                    onSendMessage={handleSendMessage}
                    spaces={spaces}
                  />
                </ProtectedRoute>
              }
            />
            <Route path="/register" element={<Register setUser={setUser} />} />
            <Route path="/login" element={<Login setUser={setUser} />} />
          </Routes>
        </div>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
